Synopsis 
Jane a toujours ete plus douee pour prendre soin du bonheur des autres que du sien. Toute sa vie, elle ses evertuee a rendre ses proches heureux, et les 27 robes de demoiselle dhonneur qui remplissent son armoire sont autant de preuves de son devouement. 
Lors d&amp;#039;une soiree memorable, Jane parvient a faire la navette entre deux receptions de mariage, lune a Manhattan, lautre a Brooklyn, sous les yeux ebahis de Kevin, un journaliste qui realise que lhistoire de cette accro aux mariages pourrait lui apporter la gloire quil espere tant. 
Pour compliquer les choses, la vie parfaitement reglee de Jane est bouleversee par larrivee de sa petite soeur, Tess. George, le patron de Jane, tombe tres vite sous le charme de Tess, et cette derniere demande tout naturellement a sa soeur dorganiser leur mariage. Mais cette fois, les choses se compliquent, car Jane est elle-meme secretement amoureuse de George... 
